INSERT INTO `articles` (`id_article`, `titre`, `contenu`, `image`, `date_publication`, `categorie`, `auteur`) VALUES
(15, 'Le Big Data, c?est quoi ?', 'L?explosion quantitative des données numériques a obligé les chercheurs à trouver de nouvelles manières de \r\nvoir et d?analyser le monde. Il s?agit de découvrir de nouveaux ordres de grandeur concernant la capture, la \r\nrecherche, le partage, le stockage, l?analyse et la présentation des données. Ainsi est né le « Big Data ». Il s?agit \r\nd?un concept permettant de stocker un nombre indicible d?informations sur une base numérique. Selon les \r\narchives de la bibliothèque numérique de l?Association for Computing Machinery (ou ACM) dans des articles \r\nscientifiques concernant les défis technologiques à relever pour visualiser les « grands ensembles de données \r\n», cette appellation est apparue en octobre 1997.', '', '2018-08-25', 'Big data', 'kacou');
INSERT INTO `articles` (`id_article`, `titre`, `contenu`, `image`, `date_publication`, `categorie`, `auteur`) VALUES
(16, 'Science des donnees', 'En termes généraux, la science des données est l\'extraction de connaissance d\'ensembles de données. Elle emploie \r\ndes techniques et des théories tirées de plusieurs autres domaines plus larges des mathématiques, la statistique \r\nprincipalement, la théorie de l\'information et la technologie de l\'information, notamment le traitement de signal, des \r\nmodèles probabilistes, l\'apprentissage automatique, l\'apprentissage statistique, la programmation informatique, ', , '2018-08-25', 'Data Science', 'kacou');
INSERT INTO `articles` (`id_article`, `titre`, `contenu`, `image`, `date_publication`, `categorie`, `auteur`) VALUES
(17, 'Bien comprendre La transformation numerique', 'Qu?il s?agisse de s?adapter au changement pour rester compétitif ou de faire évoluer une activité, la \r\ntransformation digitale de l?entreprise est devenue incontournable. Par définition, elle se réfère aux changements \r\nliés à la mise en ?uvre des technologies digitales dans toutes les strates de l?entreprise. Toute société, de la TPE \r\nau grand groupe, se pose ainsi la question de se convertir au digital. Mais qu?ont-elles réellement à y gagner ? \r\n«Aujourd?hui, la question n\'est pas de savoir si le numérique apporte des avantages aux entreprises, mais plutôt \r\ncomment elles font face à sa croissance rapide, qui impacte non seulement les ressources, les processus et les \r\nproduits, mais surtout le comportement des consommateurs», précise Tim Ringel, PDG de Netbooster(1), une \r\nagence indépendante et leader en Europe dans le déploiement de stratégies de performance digitale. Grâce au \r\nnumérique, aussi bien les données des consommateurs que les nouvelles tendances sont mesurées en temps \r\nréel. «Ce changement, aussi simple que révolutionnaire, a fait évoluer la façon dont les entreprises et les produits \r\nsont créés aujourd\'hui», ajoute le fondateur de Netbooster, qui intervient comme consultant auprès des sociétés \r\npour optimiser leurs performances numériques.', '', '2018-08-25', 'Transformation Numerique', 'kacou'),
(18, 'HTML CSS JAVASCRIPT LES OUTILS DU WEB', 'L\'HyperText Markup Language, généralement abrégé HTML, est le langage de balisage conçu pour représenter les \r\npages web. C\'est un langage permettant d\'écrire de l\'hypertexte, d\'où son nom.\r\n\r\nLes feuilles de style en cascade, généralement appelées CSS de l\'anglais Cascading Style Sheets, forment un langage \r\ninformatique qui décrit la présentation des documents HTML et XML.', '', '2018-08-25', 'html', 'Innocent');

